prichiny:
คู่สนทนาของคุณมีการป่วยและเบื่อคำถามโง่ ๆ ของคุณปัญญาอ่อนหรือโง่ขอคำปรึกษา;
คุณดูถูกคู่สนทนาของคุณด้วยการทำให้ความสนุกของ (หรือเธอ) ของเขารสนิยมทางศาสนาหรือการเมืองการดูละครเพลงหรือภาพยนตร์หรือวิจารณ์ (หรือเธอ) ชีวิตของเขาใช้ส่วนบุคคลและ / หรือสิ่งที่เขา (หรือเธอ) ถือหุ้นอยู่กับหัวใจที่รัก (หรือเธอ) ของเขา ;
มีคนบอกว่าเขา (หรือเธอ) จะไม่จ่ายเงินให้คุณกลับพวกเขาเงินเขา (หรือเธอ) เป็นหนี้คุณหางานหรือสิ่งที่เขา (หรือเธอ) ยืม;
มีคนบอกว่าเขา (หรือเธอ) จะไม่ได้มีเพศสัมพันธ์กับคุณอีกครั้งหรือที่ทุก
แค่ใครไม่ต้องการที่จะให้ติดต่อกับคุณ โชคไม่ดีที่เกิดขึ้นเช่นกัน ...

sovety:
วิธีการและทัศนคติของคนที่ส่งคุณมาที่นี่ของคุณพิจารณา;
ข้อเสนอแนะนี้ใช้ส่วนบุคคลและได้รับบทสรุปมันที่คนที่ส่งคุณมาที่นี่;
บุ๊คมาร์คเว็บไซต์นี้และใช้เวลาต่อไปที่คุณจำเป็นต้องบอกใครซักคนที่เพียงแค่ส่งเขา (หรือเธอ) การเชื่อมโยงน
